import {Routes, Route, Link, Outlet} from 'react-router-dom';
import ProjectPage from './ProjectPage';
const projects = [
    { id: 1, title: 'Project 1', description: 'Really cool stuff' },
    { id: 2, title: 'Project 2', description: 'Even cooler stuff' },
    { id: 3, title: 'Project 3', description: 'How does she do it!!' },
  ];

function ProjectList(projects) {
    return (
        <ul>
            {projects.map((project) => (
                <li key={project.id}>
                    <h3><Link to={project.id}>{project.title}</Link></h3>
                    <p>{project.description}</p>
                </li>
            ))}
            {/* <div className="project-card">
                <h3>Project 1</h3>
                <p></p>
                <Link to="1">Learn more</Link>
            </div>
            <div className="project-card">
                <h3>Project 2</h3>
                <p></p>
                <Link to="2">Learn more</Link>
            </div>
            <div className="project-card">
                <h3>Project 3</h3>
                <p></p>
                <Link to="3">Learn more</Link>
            </div> */}
        </ul>
    );
}

const Projects = () => {
    return (
        <div className="project-feed">
            <h2>
                Projects
            </h2>

            <Routes>
                <Route index element={<ProjectList projects={projects} />} />
                <Route path="1" element={<ProjectPage projectId={1} />}/>
                <Route path="2" element={<ProjectPage projectId={2} />} />
                <Route path="3" element={<ProjectPage projectId={3}/>}/>
            </Routes>
        </div>
    );
};

export default Projects;
